// Código de About.js
import React from 'react';

function About() {
  return (
    <section className="about">
      <h2>Sobre Mí</h2>
      <p>
        Soy un desarrollador apasionado por construir soluciones modernas, eficientes y escalables.
        Mi experiencia se centra en el desarrollo backend, utilizando tecnologías como PHP y Python, con un sólido manejo
        de bases de datos MySQL y MariaDB.
      </p>
      <p>
        Me especializo en diseñar y mantener sistemas robustos, optimizados para alto rendimiento y
        con una arquitectura bien estructurada. También disfruto trabajar en proyectos colaborativos que
        generan un impacto positivo, mientras continúo aprendiendo y explorando nuevas tecnologías para mantenerme actualizado
        en un entorno en constante evolución.
      </p>
    </section>
  );
}

export default About;
